// ContentTiles Component
// --------------------------------------------------------

import React from 'react';
import PropTypes from 'prop-types';
import './styles.scss';
import classname from 'classnames';

const ContentTiles = ({ className, background, children }) => {
  const classNames = classname('a-content-tiles', className, background);
  return <div className={classNames}>{children}</div>;
};

ContentTiles.propTypes = {
  className: PropTypes.string,
  background: PropTypes.string,
  children: PropTypes.node
};

ContentTiles.defaultProps = {
  className: '',
  background: '',
  children: ''
};

export default ContentTiles;
